/// <summary>
/// Inits the form values.
/// </summary>
/// <remarks>
/// The WMSJournalTable form init method.
/// </remarks>
void init()
{
    xArgs args = this.args();

    // default journal type based on menu item name, this is to ensure query durable between caller.
    if (args && !args.parmEnumType())
    {
        switch (args.menuItemName())
        {
            case menuItemDisplayStr(WMSJournalProduction):
                args.parmEnumType(enumNum(WMSJournalType));
                args.parmEnum(enum2int(WMSJournalType::Production));
                break;
            case menuItemDisplayStr(WMSJournalReception):
                args.parmEnumType(enumNum(WMSJournalType));
                args.parmEnum(enum2int(WMSJournalType::Reception));
                break;
        }
    }

    if (args
        && !args.record().RecId
        && (args.lookupTable() == tableNum(WMSJournalTable)
        && args.lookupField() == fieldNum(WMSJournalTable, JournalId)))
    {
        WMSJournalTable journal = WMSJournalTable::find(args.lookupValue());

        args.record(journal);
    }

    journalFormTable = new WMSJournalFormTable(element);
    journalFormTrans = new WMSJournalFormTrans(element);
    journalFormTrans.parmJournalFormTable(journalFormTable);

    //since the journalFormTable returned by journalForm() is the main controller of this class and therefor we need to pass the controller for lines so it can receive callbacks.
    journalFormTable.parmWMSJournalFormTrans(journalFormTrans);

    if (#PdsCatchWeightEnabled)
    {
        cwFormCtrl = PdsCWFormCtrl::constructFromForm(element);
        journalFormTrans.parmPdsCWFormCtrl(cwFormCtrl);
        cwFormCtrl.initPre();
    }

    super();

    journalFormTrans.parmCtrlLineLogImage(lineLogImage);

    journalFormTrans.parmCtrlCreateSerialIds(wmsJournalTransUpdateSerialId);
    journalFormTrans.parmCtrlGridInventTransRefId(wmsJournalTrans_inventTransRefId);
    journalFormTrans.parmCtrlInventTransRefId(inventTransRefId);
    journalFormTrans.parmCtrlGridInventTransId(wmsJournalTrans_inventTransId);
    journalFormTrans.parmCtrlInventTransId(inventTransId);
    journalFormTrans.parmCtrlGridItemId(journalTrans_ItemId);
    journalFormTrans.parmCtrlItemId(itemId);
    journalFormTrans.parmCtrlInventTransType(inventTransType);
    journalFormTrans.parmCtrlVendAccount(vendAccountCopy1);
    journalFormTrans.parmCtrlGridReturnItemNum(returnOrder_ReturnItemNum);
    journalFormTrans.parmCtrlReturnDispositionCodeId(returnOrder_ReturnDispositionCodeId);
    journalFormTrans.parmCtrlInfolog(showInfoLogLine);

    journalFormTable.parmCtrlJournalTypeGrid(wmsJournalTable_JournalType);
    journalFormTable.parmCtrlJournalIdTab(journalId);
    journalFormTable.parmCtrlJournalIdGrid(wmsJournalTable_JournalId);
    journalFormTable.parmCtrlOverview(gridOverview);
    journalFormTable.parmCtrlMarkUserBlock(markUserBlock);
    journalFormTable.parmCtrlMarkInUseBlock(markInUseBlock);
    journalFormTable.parmCtrlSystemBlocked(systemBlocked);
    journalFormTable.parmCtrlBlockImage(blockImage);
    journalFormTable.parmCtrlInitTotals(initTotals);
    journalFormTable.parmCtrlFunctionsLinesButton(FunctionsLinesMenu);
    journalFormTable.parmCtrlNewDeleteLineGroup(NewDeleteGroup);
    journalFormTable.parmCtrlCheckJournal(checkJournal);
    journalFormTable.parmCtrlPostJournal(postJournal);
    journalFormTable.parmCtrlInfolog(showInfolog);

    journalFormTable.parmCtrlCreateLines(wmsJournalCreateLines);
    journalFormTable.parmCtrlPackingSlipUpdate(purchFormLetter_PackingSlip);
    journalFormTable.parmCtrlPackingSlipUpdateSales(salesFormLetter_PackingSlip);
    journalFormTable.parmCtrlTransferOrderReceive(inventTransferReceive);

    journalFormTable.parmCtrlReturnDispositionCodeId(returnOrders_ReturnDispositionCodeId);
    journalFormTable.parmCtrlReturnItemNum(returnOrders_ReturnItemNum);

    journalFormTable.parmCtrlVendAccount(vendAccount);

    journalFormTable.formInitPost();
}

