/// <summary>
/// Add a new option for item arrival journal line in office menu.
/// </summary>
/// <param name = "_menuOptions">Office menu option for a form.</param>
public void customizeMenuOptions(OfficeMenuOptions _menuOptions)
{
    List exportOptions = _menuOptions.customMenuItems();

    var exportOption = OfficeGeneratedExportMenuItem::construct(dataentityviewstr(WMSItemArrivalJournalLineV2Entity), ExportItemArrivalJournalLineToExcelOptionId);
    exportOption.displayName(strfmt("@SYS76681", "@SCM:WMSItemArrivalJournalLineV2EntityLabel", '', curExt()));
    exportOptions.addEnd(exportOption);
}

/// <summary>
/// Add filter for export option in the office menu for item arrival journal line entity.
/// </summary>
/// <param name = "_menuItem">Export menu item in the office menu.</param>
/// <returns>Data entity context needed for exporting to excel.</returns>
public ExportToExcelDataEntityContext getDataEntityContext(OfficeGeneratedExportMenuItem _menuItem)
{
    ExportToExcelDataEntityContext context = null;

    switch (_menuItem.id())
    {
        case ExportItemArrivalJournalLineToExcelOptionId:
            context = ExportToExcelDataEntityContext::constructDefault(dataentityviewstr(WMSItemArrivalJournalLineV2Entity));

            var itemArrivalJournalLineV2EntityInfo = context.findEntityByName(dataentityviewstr(WMSItemArrivalJournalLineV2Entity));

            var itemArrivalJournalLineV2EntityFilterBuilder = new ExportToExcelFilterTreeBuilder(dataentityviewstr(WMSItemArrivalJournalLineV2Entity));
            var itemArrivalJournalLineV2EntityFilter = itemArrivalJournalLineV2EntityFilterBuilder.areEqual(fieldStr(WMSItemArrivalJournalLineV2Entity, JournalNumber), WMSJournalTrans.journalId);
            itemArrivalJournalLineV2EntityInfo.filter(
                itemArrivalJournalLineV2EntityFilterBuilder.and(
                itemArrivalJournalLineV2EntityFilterBuilder.companyFilter(),
                itemArrivalJournalLineV2EntityFilter));

            break;
    }

    return context;
}

edit BarcodeEAN128AIDataValue barCodeEAN128(boolean _set, BarcodeEAN128AIDataValue _str)
{
    BarcodeEAN128       barcodeEAN128;
    InventItemBarcode   inventItemBarcode;

    if (_set)
    {
        if (#PdsCatchWeightEnabled)
        {
            barcodeEAN128 = BarcodeEAN128::construct();
            barcodeEAN128.decode(_str);
            inventItemBarcode = barcodeEAN128.getItemInfo();

            if (inventItemBarcode
                && inventItemBarcode.ItemId
                && PdsGlobal::pdsIsCWItem(inventItemBarcode.ItemId))
            {
                throw error(strFmt("@PDS95", inventItemBarcode.ItemId));
            }
        }
        journalFormTrans.barCodeEAN128(_str);
    }

    return '';
}

void write()
{
    ttsbegin;

    wmsJournalTable.InventDimId = InventDim::findOrCreate(inventDimTable).InventDimId;

    super();

    journalFormTable.datasourceWritePost();

    if (wmsJournalTable.InventDimId != inventDimTable.InventDimId)
    {
        inventDimTable.data(InventDim::find(wmsJournalTable.InventDimId));
        inventDimTable_ds.setCurrent();
    }

    ttscommit;
}

void delete()
{
    try
    {
        inDelete = true;
        ttsbegin;

        super();

        journalFormTable.datasourceDeletePost();
        journalFormTrans.journalTableData(null);

        ttscommit;
        inDelete = false;
    }
    catch(Exception::Error)
    {
        inDelete = false;
        throw Exception::Error;
    }
    catch(Exception::UpdateConflict)
    {
        inDelete = false;
        throw Exception::UpdateConflict;
    }
    catch(Exception::CodeAccessSecurity)
    {
        inDelete = false;
        throw Exception::CodeAccessSecurity;
    }
    catch(Exception::UpdateConflictNotRecovered)
    {
        inDelete = false;
        throw Exception::UpdateConflictNotRecovered;
    }
}

