    wmsJournalTrans.InventDimId    = InventDim::findOrCreate(inventDimTrans).InventDimId;

    ret = super();

    ret = journalFormTrans.datasourceValidateWritePost(ret);

    return ret;
}

void write()
{
    if (!journalFormTrans.promptSplitReturnLine())
    {
        return;
    }

    ttsbegin;

    wmsJournalTrans.InventDimId    = InventDim::findOrCreate(inventDimTrans).InventDimId;
    inventDimTrans.inventDimId = wmsJournalTrans.InventDimId;

    journalFormTrans.datasourceWritePre();

    boolean doKitResearch = kittingFormHandler && kittingFormHandler.mustResearch(WMSJournalTrans);
    WMSJournalTrans kittingCursor = WMSJournalTrans.data();

    super();

    journalFormTrans.datasourceWritePost();

    ttscommit;

    if (wmsJournalTrans.InventDimId != inventDimTrans.InventDimId)
    {
        inventDimTrans.data(InventDim::find(wmsJournalTrans.InventDimId));
        inventDimTrans_ds.setCurrent();
    }

    if (doKitResearch)
    {
        this.research();
        WMSJournalTrans_ds.positionToRecord(kittingCursor);
    }
}

